    [],nt"revision_timestamp": "2016-07-27T23:05:33.664248",nt"name": "annual-report-cooperative-recovery-initiative-big-river-mussel-project-fy2013",nt"isopen":
    false,nt"url": null,nt"notes": "This report documents the progress made
    in FY13 on the establishment of 2-4 new populations of four federally listed mussel
    species (clubshell, orange-foot pimpleback, spectaclecase, and purple cat's paw)
    in, or near, the Ohio River Islands National Wildlife Refuge. Specifically, the
    author reports on progress concerning the following objectives: 1) Establish baseline
    mussel community and habitat conditions at two to four restoration sites on and
    near refuge 2) Translocate trial populations of clubshell adults (> 50 each) to
    2 u2013 4 sites and collect genetic samples from Middle Island Cr. Collect broodstock
    and propagate juveniles.  3) Stock cultured juveniles of northern riffleshell as
    a congener surrogate species in silos at 2 u2013 4 sites. 4) Propagate juvenile
    purple catu2019s paw and culture to taggable size. 5) Aggregate 20 to 100 Orange-foot
    pimpleback adults into river refugia to monitor reproductive condition 6) Collect
    genetic samples of spectaclecase from additional streams, collect gravid females
    and refine propagation techniques.",nt"license_title": "License Not Specified",nt"extras":
